INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (7001, 1, 1, 7, 0.0, "2030/12/17 14:59:59", "キャル", 0.0, 1, 0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0, -363.0, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (7002, 1, 1, 7, 0.0, "2030/12/17 14:59:59", "コッコロ", 0.0, 1, 0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0, -363.0, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (7003, 1, 1, 7, 0.0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 1, 0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0, -363.0, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10001, 1, 1, 10, 0.0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 1, 0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0, -363.0, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10002, 1, 1, 10, 0.0, "2030/12/17 14:59:59", "キャル", 0.0, 1, 0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0, -363.0, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10003, 1, 1, 10, 0.0, "2030/12/17 14:59:59", "コッコロ", 0.0, 1, 0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0, -363.0, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10004, 2, 1, 10, 0.0, "2030/12/17 14:59:59", "シェフィ", 0.0, 1, 2104010, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 0, -363.0, "2015/12/17 15:00:00", 106401);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (12001, 1, 1, 12, 0.0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 1, 0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0, -416.5, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (13001, 1, 1, 13, 0.0, "2030/12/17 14:59:59", "キャル", 0.0, 1, 0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0, -363.0, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (13002, 1, 1, 13, 0.0, "2030/12/17 14:59:59", "コッコロ", 0.0, 1, 0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0, -363.0, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (13003, 2, 1, 13, 0.0, "2030/12/17 14:59:59", "シェフィ", 0.0, 1, 2104010, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 0, -363.0, "2015/12/17 15:00:00", 106401);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (13004, 1, 1, 13, 0.0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 1, 0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0, -363.0, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (14001, 1, 1, 14, 0.0, "2030/12/17 14:59:59", "コッコロ", 0.0, 1, 0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0, -363.0, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (14002, 2, 1, 14, 0.0, "2030/12/17 14:59:59", "シェフィ", 0.0, 1, 2104010, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 0, -363.0, "2015/12/17 15:00:00", 106401);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (14003, 1, 1, 14, 0.0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 1, 0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0, -363.0, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (14004, 1, 1, 14, 0.0, "2030/12/17 14:59:59", "キャル", 0.0, 1, 0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0, -363.0, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (15001, 1, 1, 15, 0.0, "2030/12/17 14:59:59", "コッコロ", 0.0, 1, 0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0, -470.0, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (16001, 2, 1, 16, 0.0, "2030/12/17 14:59:59", "シェフィ", 0.0, 1, 2104010, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 0, -363.0, "2015/12/17 15:00:00", 106401);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (16002, 1, 1, 16, 0.0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 1, 0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0, -363.0, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (16003, 1, 1, 16, 0.0, "2030/12/17 14:59:59", "キャル", 0.0, 1, 0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0, -363.0, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (16004, 1, 1, 16, 0.0, "2030/12/17 14:59:59", "コッコロ", 0.0, 1, 0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0, -363.0, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (17002, 1, 1, 17, 0.0, "2030/12/17 14:59:59", "コッコロ", 0.0, 1, 0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0, -363.0, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (17004, 1, 1, 25, 0.0, "2030/12/17 14:59:59", "キャル", 0.0, 1, 0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0, -363.0, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (17005, 1, 1, 25, 0.0, "2030/12/17 14:59:59", "コッコロ", 0.0, 1, 0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0, -363.0, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (17006, 2, 1, 25, 0.0, "2030/12/17 14:59:59", "シェフィ", 0.0, 1, 2104010, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 0, -363.0, "2015/12/17 15:00:00", 106401);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (17007, 1, 1, 25, 0.0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 1, 0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0, -363.0, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (18001, 1, 1, 18, 0.0, "2030/12/17 14:59:59", "カリン", 0.0, 1, 0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0, -363.0, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (18002, 1, 1, 18, 0.0, "2030/12/17 14:59:59", "カリン", 0.0, 2, 0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0, -363.0, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (19001, 1, 1, 19, 0.0, "2030/12/17 14:59:59", "カリン", 0.0, 3, 0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0, -470.0, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (19002, 1, 1, 19, 0.0, "2030/12/17 14:59:59", "カリン", 0.0, 4, 0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0, -470.0, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (20001, 1, 1, 20, 0.0, "2030/12/17 14:59:59", "カリン", 0.0, 5, 0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0, -470.0, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (20002, 1, 1, 20, 0.0, "2030/12/17 14:59:59", "カリン", 0.0, 6, 0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0, -470.0, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (21001, 1, 1, 21, 0.0, "2030/12/17 14:59:59", "キャル", 0.0, 1, 0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0, -363.0, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (21002, 1, 1, 21, 0.0, "2030/12/17 14:59:59", "コッコロ", 0.0, 1, 0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0, -363.0, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (21003, 2, 1, 21, 0.0, "2030/12/17 14:59:59", "シェフィ", 0.0, 1, 2104010, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 0, -363.0, "2015/12/17 15:00:00", 106401);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (21004, 1, 1, 21, 0.0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 1, 0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0, -363.0, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (22001, 1, 1, 22, 0.0, "2030/12/17 14:59:59", "カリン", 0.0, 1, 0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0, -430.0, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (22002, 1, 1, 22, 0.0, "2030/12/17 14:59:59", "カリン", 0.0, 2, 0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0, -430.0, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (23001, 1, 1, 23, 0.0, "2030/12/17 14:59:59", "カリン", 0.0, 3, 0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0, -430.0, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (23002, 1, 1, 23, 0.0, "2030/12/17 14:59:59", "カリン", 0.0, 4, 0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0, -430.0, "2015/12/17 15:00:00", 190801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24001, 1, 2, 24, 8.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 4.08, 1, 0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 10011, -385.0, "2019/01/31 12:00:00", 109001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24002, 1, 2, 24, 8.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 5.0, 2, 0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 10011, -385.0, "2019/01/31 12:00:00", 109001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24003, 1, 2, 24, 8.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 10.11, 3, 0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 10011, -385.0, "2019/01/31 12:00:00", 109001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24004, 1, 2, 24, 8.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 4.0, 4, 0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 10011, -385.0, "2019/01/31 12:00:00", 109001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24005, 1, 2, 24, 8.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 6.0, 5, 0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 10011, -385.0, "2019/01/31 12:00:00", 109001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24006, 1, 1, 24, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 6, 0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 10011, 0.0, "2019/01/31 12:00:00", 109002);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24007, 1, 1, 24, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 7, 0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 10011, 0.0, "2019/01/31 12:00:00", 109002);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24008, 1, 1, 24, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 8, 0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 10011, 0.0, "2019/01/31 12:00:00", 109002);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24009, 1, 1, 24, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 9, 0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 10011, 0.0, "2019/01/31 12:00:00", 109002);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24010, 1, 1, 24, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 0.0, 10, 0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 10011, 0.0, "2019/01/31 12:00:00", 109002);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24011, 1, 2, 24, 8.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 2.12, 1, 0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 10011, -385.0, "2019/01/31 12:00:00", 109101);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24012, 5, 2, 24, 8.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 4.19, 2, 0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 10011, -385.0, "2019/01/31 12:00:00", 109101);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24013, 2, 4, 24, 8.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 2.3, 3, 0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 10011, -385.0, "2019/01/31 12:00:00", 109101);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24014, 1, 1, 24, 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 4, 0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 10011, 0.0, "2019/01/31 12:00:00", 109102);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24015, 5, 2, 24, 8.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 5.23, 5, 0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 10011, -385.0, "2019/01/31 12:00:00", 109101);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24016, 1, 1, 24, 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 6, 0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 10011, 0.0, "2019/01/31 12:00:00", 109102);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24017, 1, 2, 24, 8.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 5.01, 7, 0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 10011, -385.0, "2019/01/31 12:00:00", 109101);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24018, 1, 1, 24, 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 8, 0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 10011, 0.0, "2019/01/31 12:00:00", 109102);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24019, 1, 1, 24, 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 9, 0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 10011, 0.0, "2019/01/31 12:00:00", 109102);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (24020, 1, 1, 24, 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 0.0, 10, 0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 10011, 0.0, "2019/01/31 12:00:00", 109102);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (26001, 2, 1, 26, 0.0, "2030/12/17 14:59:59", "シェフィ", 0.0, 1, 2104010, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 0, -363.0, "2015/12/17 15:00:00", 106401);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (26002, 1, 1, 26, 0.0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 1, 0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 0, -363.0, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (26003, 1, 1, 26, 0.0, "2030/12/17 14:59:59", "キャル", 0.0, 1, 0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 0, -363.0, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (26004, 1, 1, 26, 0.0, "2030/12/17 14:59:59", "コッコロ", 0.0, 1, 0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 0, -363.0, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (27001, 2, 1, 27, 0.0, "2030/12/17 14:59:59", "シェフィ", 0.0, 1, 2104010, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 0, -363.0, "2015/12/17 15:00:00", 106401);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (27002, 1, 1, 27, 0.0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 1, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 0, -363.0, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (27003, 1, 1, 27, 0.0, "2030/12/17 14:59:59", "キャル", 0.0, 1, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 0, -363.0, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (27004, 1, 1, 27, 0.0, "2030/12/17 14:59:59", "コッコロ", 0.0, 1, 0, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 0, -363.0, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (28001, 1, 1, 28, 0.0, "2030/12/17 14:59:59", "カリン", 0.0, 1, 0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 0, -363.0, "2019/09/24 15:00:00", 190801);
