INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (31001, 1, 1, 31, 0.0, "2030/12/17 14:59:59", "カリン", 0.0, 7, 0, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 0, -409.0, "2019/10/31 12:00:00", 190801);
