INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (41001, 1, 1, 41, 0.0, "2030/12/17 14:59:59", "シェフィ", 0.0, 1, 2104010, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 0, -363.0, "2015/12/17 15:00:00", 106401);
