INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (42002, 1, 1, 42, 0.0, "2030/12/17 14:59:59", "シェフィ", 0.0, 1, 2104010, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 0, -416.5, "2015/12/17 15:00:00", 106401);
