INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (43001, 1, 1, 43, 0.0, "2030/12/17 14:59:59", "ペコリーヌ", 0.0, 1, 0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 0, -363.0, "2015/12/17 15:00:00", 105801);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (43002, 1, 1, 43, 0.0, "2030/12/17 14:59:59", "コッコロ", 0.0, 1, 0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 0, -363.0, "2015/12/17 15:00:00", 105901);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (43003, 1, 1, 43, 0.0, "2030/12/17 14:59:59", "キャル", 0.0, 1, 0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 0, -363.0, "2015/12/17 15:00:00", 106001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (43004, 1, 1, 44, 0.0, "2030/12/17 14:59:59", "アメス", 0.0, 1, 0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 0, -416.5, "2015/12/17 15:00:00", 123001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (43005, 1, 1, 44, 0.0, "2030/12/17 14:59:59", "アメス", 0.0, 2, 0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 0, -416.5, "2015/12/17 15:00:00", 123001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (43006, 1, 2, 45, 0.0, "2030/12/17 14:59:59", "アメス", 5.79, 3, 0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 0, -416.5, "2015/12/17 15:00:00", 123001);
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (46001, 1, 1, 46, 0.0, "2030/12/17 14:59:59", "アメス", 0.0, 1, 0, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 0, -371.5, "2015/12/17 15:00:00", 123001);
